import React, { Component } from 'react';
import styled from  'styled-components';
import Iframe from 'react-iframe'
 
class PaperHouse extends Component{

    
    render() {
        
        return(
                 <PaperHouseForm>
                     <PaperHouseTitle>PaperHouse</PaperHouseTitle>
                     <VideoForm>
                     <video controls autoPlay>
                         <source src={process.env.PUBLIC_URL+'/video/PaperHouse.mp4'} type="video/mp4"></source>
                     </video>
                     </VideoForm>
                     <GoTop><span>빠른이동</span><br></br><Top onClick={this.scrollToTop}>시연영상</Top><br></br><br></br><Top>개발기술서</Top></GoTop>
                   <Pdf>
                   <Iframe marginWidth='0' width="100%" height="120%" scrolling='no' frameBorder='0' src={process.env.PUBLIC_URL+'/img/SimpleFive.pdf'}/>
                   </Pdf>
                  
                 </PaperHouseForm>
        );
    }
}

export default PaperHouse;

const PaperHouseForm = styled.div `
   background-color:#e4e978;
   width:100%;
   height:280%;
   text-align:center;
   display:flow-root;
`

const PaperHouseTitle = styled.h1`
    color: #d37815;
    
`
const VideoForm = styled.div `
  
`

const GoTop = styled.div `
  
  position: fixed;
    width: 92px;
    height: 24.5px;
    left: 1270px;
    top: 250px;
 
    margin:0 auto;
`
const Top = styled.a`
  color:black;
  
    font-size: 1.15em;
`
const Test = styled.div `

  height:10%;
  width:100%;
  background-color:#e4e978;
`

const Pdf = styled.div `
  margin-top:20%;
  width:90%;
  height:30%;
`
